package com.pixelpioneer.moneymaster.core.di

import com.pixelpioneer.moneymaster.core.initialization.AppInitializer
import com.pixelpioneer.moneymaster.core.initialization.CategoryInitializer
import com.pixelpioneer.moneymaster.data.repository.CategoryRepository
import dagger.Module
import dagger.Provides
import dagger.hilt.InstallIn
import dagger.hilt.components.SingletonComponent
import dagger.multibindings.IntoSet
import javax.inject.Singleton

@Module
@InstallIn(SingletonComponent::class)
object AppModule {

    @Provides
    @IntoSet
    @Singleton
    fun provideCategoryInitializer(categoryRepository: CategoryRepository): AppInitializer {
        return CategoryInitializer(categoryRepository)
    }
}
